import React from 'react'
import { Stocks } from "../Stocks";
import { Link, Route } from 'react-router-dom'
import { nikeAir } from "../data";
function Models() {
    return (
        <div>
            {nikeAir.map((item,i)=>{
                return(
<Link onClickstyle={{ 'display': 'block' }}>{item.name}</Link>
                )
            })}        
        </div>
    )
}

export default Models
